import React, {Component} from 'react';

class ViewBuilding extends Component {
	render() {
		const myBuilding = this.props.data.filter(building => {
			return building.id == this.props.selectedBuilding
		});
		//const id = this.props.selectedBuilding;
		return (
			<div>
				<p>
					{' '}
					<i>Click on a name to view more information</i>
					<p>{myBuilding}</p>
				</p>
			</div>
		);
	}
}
export default ViewBuilding;
